  state = { message: "" }
  callbackFunction = (childData) => { this.setState({ message: childData }) }

  //handleChange = val => setValue(val);


  render() {



    return (
      <Container>
        <div className="Header">
          <h1 className="logo">
            Mocker
          </h1>
          <ToggleButtonGroup type="radio" name="pages" size="lg" className="btnGrp" onChange={() => {console.log("ok")} }>
            <ToggleButton variant="danger" value="About">About</ToggleButton>
            <ToggleButton variant="danger" value="Share" active>Share</ToggleButton>
            <ToggleButton variant="danger" value="Create" active>Create</ToggleButton>
            <ToggleButton variant="danger" value="Load">Load</ToggleButton>
            <ToggleButton variant="danger" value="Donate">Donate</ToggleButton>
          </ToggleButtonGroup>



        </div>
        <Mock parentCallback={this.callbackFunction}/>

      </Container>

    );
  }
}


export default App;
